import styled from 'styled-components';

export const Container = styled.div`
  height: 64px;
  padding: 0 30px;
  max-width: 400px;
  justify-content: space-between;

`;

export const Content = styled.div`
  height: 64px;
  max-width: 900px;
  margin: 0 auto;
  display: flex;
  justify-content: space-between;
  align-items: center; 
`;

export const Profile = styled.div``;
